      SELECT DISTINCT + + 79 + 33 AS col1, 21 FROM tab1 (FORMAT parquet) WHERE NOT - - ( 86 ) * - 62 * + col2 + + col0 = + col0 * col1;
  - name: tab1

outputs:
  - name: q13045.out
    data: |
      112	21
